let bigAdd l1 l2 = 
  let add (l1, l2) = 
    let f a x = let (c, num) = x in let (ca, r) = a in
        match r with
          | [] -> let ((ca+c)+num) = val1 in 
                if val1 < 10 then (0, [ca] @ [val1])
                else (ca+1, [ca+1] @ [val1 mod 10])
          | h::t -> let c+num+h = val2 in
                if val2 < 10 then (0, [0] @ val2 @ t)
                else (ca+1, [val2/10] @ [val2 mod 10] @ t)
    in
    let base = (0,[]) in
    let args = List.rev(List.combine l1 l2) in
    let (_, res) = List.fold_left f base args in
      res
  in 
    removeZero (add (padZero l1 l2))

